import { initializeApp } from "firebase/app";
import { getAuth,signOut} from "firebase/auth";

import { useNavigate } from "react-router-dom";
function Main() {
  
   
    const navigate = useNavigate()



  const firebaseConfig = {
    apiKey: "AIzaSyClEH1wG_p4Bk7y8dl88UEi1OcSmd_7Yl4",
    authDomain: "pro-app-7adb5.firebaseapp.com",
    projectId: "pro-app-7adb5",
    storageBucket: "pro-app-7adb5.appspot.com",
    messagingSenderId: "840528707586",
    appId: "1:840528707586:web:759e54f6d5ecf02251671b",
    measurementId: "G-Q000JTLWD8"
};


const app = initializeApp(firebaseConfig);
const auth = getAuth()



const submitData = (event) => {
    event.preventDefault()


    signOut(auth)
        .then(() => {
            alert("Logout successfull")
            navigate("/Login")
        })
        .catch(() => {
            alert("error")
        })
}




  return (
    <div class="container-fluid">
      <div class="row">
        <div class="col">
          <img style={{ width: "100px" }} src="https://img.freepik.com/free-vector/gradient-mobile-store-logo-design_23-2149699848.jpg?w=740&t=st=1701666843~exp=1701667443~hmac=523dd72428ea2739fef2462bb17c5667cfed8229a32339f675973d1fc6b70713"></img>
        </div>
        <div class="col">
          <h3 style={{ marginTop: "20px", position: "absolute", left: "200px" }}> MOBILE STORE</h3>
        </div>

        <div class="col">
          <form class="d-flex" role="search" style={{ marginTop: "20px" }} >
            <input style={{ width: "400px" }} class="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
            <button class="btn btn-outline-success" type="submit">Search</button>
          </form>
        </div>
        <div class="col">
          <i style={{ marginLeft: "17px", marginTop: "20px", border: "1px solid black ", borderRadius: "50%", padding: "10px" }} class="fa-solid fa-cart-shopping "></i>
        </ div>
        <div class="col">
          <form id="log" onSubmit={submitData}>
            <button type="submit" class="btn btn-danger">Logout</button>
          </form></div>
      </ div>
    </ div>

  )

}
    
      export default Main;
